import Vue from 'vue';
import VueRouter from 'vue-router';
import WasteList from '../components/WasteList.vue';
import WasteForm from '../components/WasteForm.vue';

Vue.use(VueRouter);

export default new Router({
    routes: [
        {
            path: '/',
            name: 'WasteList',
            component: WasteList
        },
        {
            path: '/waste/add',
            name: 'AddWaste',
            component: WasteForm
        },
        {
            path: '/waste/edit/:id',
            name: 'EditWaste',
            component: WasteForm,
            props: true
        }
    ]
});
